import { useParams } from "react-router-dom";
import { useState, useEffect } from "react";

import Loading from "../components/loadingScreen";
import FeedbackForm from "../pages/feedbackForm";
import { getUserFormSettingsByApiKey } from "./databaseRoutes";

const ApiPrivateRoute = () => {
    const { apiKey } = useParams();
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const checkUser = async () => {
            try {
                const userFormSettings = await getUserFormSettingsByApiKey(apiKey);
                if (userFormSettings) {
                    return <FeedbackForm formSettings={userFormSettings}/>;
                }
            } catch (error) {
                console.error("Error fetching user by API key:", error);
            } finally {
                setLoading(false);
            }
        };

        checkUser();
    }, [apiKey]);

    if (loading) {
        return <Loading />;
    }

    return <h1>Cannot find user</h1>;
};


export default ApiPrivateRoute;
